import * as React from 'react';
import "../css/home.css";
import NavBar from '../dynamic/NavBar';
import { useSpring, animated } from '@react-spring/web';



function Home(){
    const springs = useSpring({
        from: { x: 0 },
        to: { x: 100 },
      })

return(
    <div id='homeContainer'>
        <NavBar/>
        <div id='contentContainer'>
           <div id="skyContainer">
            
           </div>
        </div>

    
    </div>
);
}

export default Home;
